import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import styles from './SubmissionDetailPage.module.css';

const SubmissionDetailPage = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const doc = location.state?.doc;

    const [status, setStatus] = useState('신규 등록');
    const [rejectionReason, setRejectionReason] = useState('');
    const [showModal, setShowModal] = useState(false);

    const handleSubmit = () => setShowModal(true);
    const handleCancel = () => setShowModal(true);

    const confirmSubmit = () => {
        console.log('처리됨:', { status, rejectionReason });
        setShowModal(false);
        navigate(-1);
    };

    const cancelSubmit = () => setShowModal(false);

    if (!doc) return <div className={styles.container}>문서 정보가 없습니다.</div>;

    return (
        <div className={styles.container}>
            <h2 className={styles.title}>제출 서류 관리 (상세)</h2>
            <hr />

            <div className={styles.form}>
                <div className={styles.formRow}><div className={styles.label}>이름</div><div className={styles.value}>{doc.name}</div></div>
                <div className={styles.formRow}><div className={styles.label}>학과</div><div className={styles.value}>{doc.major || '물리학과'}</div></div>
                <div className={styles.formRow}><div className={styles.label}>학번</div><div className={styles.value}>{doc.studentId}</div></div>
                <div className={styles.formRow}><div className={styles.label}>서류 유형</div><div className={styles.value}>{doc.type}</div></div>
                <div className={styles.formRow}><div className={styles.label}>서류 확인</div><div className={styles.value}>[{doc.fileTitle}]</div></div>

                <div className={styles.formRow}><div className={styles.label}>1차 검토 내용</div></div>
                <div className={styles.reviewBox}>
                    - 전공 관련 경험<br />- 가계곤란 사유<br />- 가족관계증명서
                </div>

                <div className={styles.formRow}><div className={styles.label}>관리자 최종 승인</div></div>
                <div className={styles.radioGroup}>
                    {['신규 등록', '반려 처리', '승인 처리'].map(opt => (
                        <label key={opt}>
                            <input
                                type="radio"
                                name="status"
                                value={opt}
                                checked={status === opt}
                                onChange={() => setStatus(opt)}
                            /> {opt}
                        </label>
                    ))}
                </div>

                {status === '반려 처리' && (
                    <div className={styles.rejectReasonBox}>
                        - 가족관계증명서 추가 서류 제출 필요
                    </div>
                )}

                <div className={styles.buttonGroup}>
                    <button className={`${styles.button} ${styles.submitButton}`} onClick={handleSubmit}>등록</button>
                    <button className={`${styles.button} ${styles.cancelButton}`} onClick={handleCancel}>취소</button>
                </div>
            </div>

            {showModal && (
                <div className={styles.modalOverlay}>
                    <div className={styles.modal}>
                        <div className={styles.modalText}>등록하시겠습니까?</div>
                        <div className={styles.modalButtons}>
                            <button className={`${styles.modalButton} ${styles.confirm}`} onClick={confirmSubmit}>확인</button>
                            <button className={`${styles.modalButton} ${styles.dismiss}`} onClick={cancelSubmit}>취소</button>
                        </div>
                    </div>
                </div>
            )}
        </div>
    );
};

export default SubmissionDetailPage;
